import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

const name = 'jason lau';
const element = <h1>Hello, {name}</h1>;

function formatName(user) {
  return user.firstName + ' ' + user.lastName;
}
const user = {
  firstName: 'jason',
  lastName: 'lau'
};
class App extends Component {
  render() {
    return (
      element
    );
  }
}

export default App;
